import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home';
import AddUser from './components/AddUser';
import Edituser from './components/EditUser';

function App() {
  return (
    <div className="App">
      <Router>

        <Home />
        <AddUser />
        <Edituser />
      </Router>
    </div>
  );
}

export default App;
